import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';
import Box from './box';
import Grid from './grid';
class App extends Component{
  render(){
    return (
      <div className="App">
        <h1>Game of Life</h1>
        <div>
        <Grid rows={10} cols={10}/>
        </div>
      </div>
    );
  };
}

export default App;
